import styled from "styled-components";

export const Conteiner = styled.div`
  margin-top: 27px;
  padding-left: 25px;
  padding-right: 15px;
`;

export const Link = styled.a`
  display: flex;
  align-items: center;
  margin-bottom: 19px;

  text-decoration: none;
  color: black;
  max-width: max-content;
`;
